ControlPropertyState.AutoRuleBindingString:
If(
	IsBlank(txtRMTotQtyST12.Text) || IsBlank(txtShopWIPTotQtyST12.Text) || IsBlank(txtFGsTotQtyST12.Text), 
	Notify("Please fill in all required fields", NotificationType.Error), 
	UpdateContext({existingRecordST12: LookUp(ECN_Stage12, ES012_ECNReference.Value = SelectedECNNo.ES001_ECNReference)} );
	If( 
        !IsBlank(existingRecordST12),
        Patch( ECN_Stage12, existingRecordST12, 
				{
					ES012_RM_Qty: Value(txtRMTotQtyST12.Text),
					ES012_ShopWIP_Qty: Value(txtShopWIPTotQtyST12.Text),
					ES012_FG_Qty: Value(txtFGsTotQtyST12.Text),					
					ES012_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},					
                    ES012_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
        ),
        Patch( ECN_Stage12, Defaults(ECN_Stage12),
				{
					Title: SelectedECNNo.ES001_ECNReference, 
					ES012_RM_Qty: Value(txtRMTotQtyST12.Text),
					ES012_ShopWIP_Qty: Value(txtShopWIPTotQtyST12.Text),
					ES012_FG_Qty: Value(txtFGsTotQtyST12.Text),							
					ES012_ECNReference: { Value: SelectedECNNo.ES001_ECNReference, Id: LookUp( ECN_Stage1, ES001_ECNReference = SelectedECNNo.ES001_ECNReference).ID},
                    ES012_ModifyBy: { Value: varUser.User_Name, Id: LookUp(ECN_UserMaster,User_Id = varUser.User_Id).ID}
				}
			)
    );	
	If(
        !IsEmpty(Errors(ECN_Stage12)), Notify( "An error occurred while saving the record.", NotificationType.Error),
        Patch(
			ECN_Stage1, 
			LookUp(ECN_Stage1,ES001_ECNReference = SelectedECNNo.ES001_ECNReference),
            { ES001_CurrentStage: { Value: "StageClose", Id: LookUp( ECN_StageMaster, Stage_Id = "13").ID }	}
        );
        Notify("Record saved successfully!", NotificationType.Success)
    );    
	Navigate(frmHome)

)
